`;
 
 const ProductList = () => {
   return (
     <Container>
        <Navbar/>
        <Announcement/>
        <Title>Dress</Title>
        <FilterContainer>
            <Filter>filter</Filter>
            <Filter>filter2</Filter>
        </FilterContainer>
        <Products/>
        <Newsletter/>
        <Footer/>
     </Container>
   )
   }
 export default ProductList;
